import "./Expenses.css";
import ExpenseItem from "./ExpenseItem";

function Expenses(props) {

    return (
        <div className="expenses">
            <ExpenseItem title={this.props.title} amount={this.props.amount} date={this.props.date} />
            <ExpenseItem title={this.props.title} amount={this.props.amount} date={this.props.date} />
            <ExpenseItem title={this.props.title} amount={this.props.amount} date={this.props.date} />
            <ExpenseItem title={this.props.title} amount={this.props.amount} date={this.props.date} />

        </div>
    );
}

export default Expenses;


